import React from 'react'
import {DeparmentContainer} from "./department.styles";
import {getCategoryData} from "../../../utils/algorithms";
import DepartmentItem from "../department-item/department-item.component";
const Deparment = () => {
  const categoryList = getCategoryData();
  return (
    <DeparmentContainer>
      {categoryList && categoryList.map(category => (
        <DepartmentItem key={category._id} category={category}/>
      ))}
    </DeparmentContainer>
  )
}

export default Deparment
